import React, { useState } from 'react';
import PropTypes from 'prop-types';

export default function Navbar(props) {
  const [mode, setMode] = useState('light'); 
  
  const [functionName, setFunctionName] = useState("");
  const [showAlert, setShowAlert] = useState(false);
  const MsgAlert = (name) => {
    setFunctionName(name);
    setShowAlert(true);
    setTimeout(() => {
      setShowAlert(false); 
    }, 3000);
  };

  const DarkMode = () => {
    let color = document.getElementsByTagName("body")[0];
    if (mode === 'light') {
      color.style.backgroundColor = '#002244';
      color.style.color = 'white';
      setMode('dark'); 
      MsgAlert("dark mode is enable now");
    } else {
      color.style.backgroundColor = 'white';
      color.style.color = '#002244';
      setMode('light');
      MsgAlert("dark mode is disable now");
    }
  };
  const GreenMode = () => {
    let color = document.getElementsByTagName("body")[0];
    if (greenMode === 'light') {
      color.style.backgroundColor = '#ADFF2F';
      color.style.color = 'white';
      setMode('dark'); 
      MsgAlert("Green mode is enable now");
    } else {
      color.style.backgroundColor = 'white';
      color.style.color = '#ADFF2F';
      setMode('light');
      MsgAlert("Green mode is disable now");
    }
  };
  const PurpleMode = () => {
    let color = document.getElementsByTagName("body")[0];
    if (purplemode === 'light') {
      color.style.backgroundColor = '#800080';
      color.style.color = 'white';
      setMode('dark'); 
      MsgAlert("purple mode is enable now");
    } else {
      color.style.backgroundColor = 'white';
      color.style.color = '#800080';
      setMode('light');
      MsgAlert("Purple mode is disable now");
    }
  };
  
 

  return (
    <>
    <nav className={`navbar navbar-expand-lg navbar-${mode} bg-${mode === 'light' ? 'light' : 'dark'}`}>
      <div className="container-fluid">
        <a className="navbar-brand" href="/">{props.title}</a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav me-auto mb-2 mb-lg-0">
            <li className="nav-item">
              <a className="nav-link active" aria-current="page" href="/">home</a>
            </li>
            <li className="nav-item">
              <a className="nav-link disabled" aria-disabled="true">{props.able}</a>
            </li>
            <li className="nav-item">
              <a className="nav-link active" aria-disabled="true">About</a>
            </li>
            <li className="nav-item">
            </li>
          </ul>
          <form className="d-flex" role="search">
            <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search" />
            <button className="btn btn-primary" type="submit">Search</button>
          </form>
          {/* dark mode switch */}
          <div  className="form-check form-switch">
                <input  className="form-check-input mx-2" type="checkbox" role="switch" id="flexSwitchCheckDefault"onClick={DarkMode}/>
                <label  className="form-check-label" htmlFor="flexSwitchCheckDefault">{mode} mode</label>
              </div>
              {/* green mode switch */}
          <div  className="form-check form-switch">
                <input  className="form-check-input mx-2" type="checkbox" role="switch" id="flexSwitchCheckDefault"onClick={GreenMode}/>
                <label  className="form-check-label" htmlFor="flexSwitchCheckDefault">{greenMode} mode</label>
              </div>
              {/* purple mode switch */}
          <div  className="form-check form-switch">
                <input  className="form-check-input mx-2" type="checkbox" role="switch" id="flexSwitchCheckDefault"onClick={PurpleMode}/>
                <label  className="form-check-label" htmlFor="flexSwitchCheckDefault">{purplemode} mode</label>
              </div>
        </div>
      </div>
    </nav>
    {showAlert && (
        <div className="alert alert-success" role="alert">
          {functionName}
        </div>
      )}

    </>
  );
}

Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  able: PropTypes.string.isRequired
};
